import React, { Component } from "react";
import Modal from "./components/Modal";
import axios from "axios"
import Table from 'react-bootstrap/Table';

const list = [
  {professor: "aaa",
    homepage: "aa",}
]


class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      resultList: [],
      modal: false,
      activeItem: {
        professor: "",
        homepage: "",
      },
    };
  }

  componentDidMount() {
    this.refreshList();
  }

  refreshList = () => {
    axios
        .get("/api/todos/")
        .then((res) => this.setState({ resultList: res.data }))
        .catch((err) => console.log(err));
  };

  toggle = () => {
    this.setState({ modal: !this.state.modal });
  };

  handleSubmit = (item) => {
    this.toggle();

    if (item.id) {
      axios
          .put(`/api/todos/${item.id}/`, item)
          .then((res) => this.refreshList());
      return;
    }
    axios
        .post("/api/todos/", item)
        .then((res) => this.refreshList());
  };

  // handleDelete = (item) => {
  //   axios
  //       .delete(`/api/todos/${item.id}/`)
  //       .then((res) => this.refreshList());
  // };

  createItem = () => {
    const item = { professor: "", homepage: "" };

    this.setState({ activeItem: item, modal: !this.state.modal });
  };

  // editItem = (item) => {
  //   this.setState({ activeItem: item, modal: !this.state.modal });
  // };

  // displayCompleted = (status) => {
  //   if (status) {
  //     return this.setState({ viewCompleted: true });
  //   }
  //
  //   return this.setState({ viewCompleted: false });
  // };

  // renderTabList = () => {
  //   return (
  //       <div className="nav nav-tabs">
  //       <span
  //           // onClick={() => this.displayCompleted(true)}
  //           // className={this.state.viewCompleted ? "nav-link active" : "nav-link"}
  //       >
  //         Result
  //       </span>
  //       </div>
  //   );
  // };

  renderItems = () => {
    // const { viewCompleted } = this.state;
    // const newItems = this.state.todoList.filter(
    //     (item) => item.completed === viewCompleted
    // );
    const newItems = this.state.resultList
    return newItems.map((item) => (
        <li
            key={item.professor}
            className="list-group-item d-flex justify-content-between align-items-center"
        >
            <span
                className={`todo-title mr-2`}
                title={item.Date}
            >
                <Table striped bordered hover>
                    <thead>
                <tr>
                    <th>Stock List</th>
                    <th>StockID</th>
                    <th>Date</th>
                    <th>LowPrice</th>
                    <th>HighPrice</th>
                    <th>OpenPrice</th>
                    <th>ClosePrice</th>
                    <th>Volume</th>
                </tr>
                </thead>
              <tbody>
                <tr>
                  <td>#</td>
                  <td>{item.StockID}</td>
                  <td>{item.Date}</td>
                  <td>{item.LowPrice}</td>
                    <td>{item.HighPrice}</td>
                     <td> {item.OpenPrice}</td>
                     <td>{item.ClosePrice}</td>
                     <td>{item.Volume}</td>
                </tr>
              </tbody>
            </Table>

            </span>
          <span>
              <button
                  onClick={() => this.editItem(item)}
                  className="btn btn-info mr-2"
              >
                {" "}
                Edit{" "}
              </button>
              <button
                  onClick={() => this.handleDelete(item)}
                  className="btn btn-info"
              >
                Delete{" "}
              </button>
            </span>
        </li>
    ));
  };

  render() {
    return (
        <main className="container">
          <h1 className="text-white text-uppercase text-center my-4">Professor Search Engine</h1>
          <div className="row">
            <div className="col-md-6 col-sm-10 mx-auto p-0">
              <div className="card p-3">
                <div className="mb-4">
                  <button
                      className="btn btn-primary"
                      onClick={this.createItem}
                  >
                    Enter Query
                  </button>
                </div>
                {/*{this.renderTabList()}*/}
                <ul className="list-group list-group-flush border-top-0">
                  {this.renderItems()}
                </ul>
              </div>
            </div>
          </div>
          {this.state.modal ? (
              <Modal
                  activeItem={this.state.activeItem}
                  toggle={this.toggle}
                  onSave={this.handleSubmit}
              />
          ) : null}
        </main>
    );
  }
}

export default App;
